// App.js

import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="Header">
        <div className="Logo">
          <img src="logo.svg" alt="Logo" />
        </div>
        <div className="Subscription">
          <input type="email" placeholder="Join the community" />
          <button>Subscribe</button>
        </div>
      </header>
      <div className="Content">
        <img src="header-image.svg" alt="Header" className="HeaderImage" />
      </div>
    </div>
  );
}

export default App;
